import React, { Component } from 'react'
class ItemNovedad extends Component {
    constructor (props){
        super(props)

    }
    render() {
        return (
            <div>
                <div class="card col-md-6 offset-md-3 text-light bg-dark" >
                     <div class="card-body">
                        <h5 class="card-title">{this.props.titulo}</h5>
                        <h6 class="card-subtitle mb-2 text-muted">{this.props.decripcion}</h6>
                     </div>
                </div>
            </div>
        )
    }
}

export default  ItemNovedad ;
